<style>
*{margin:0;padding:0;box-sizing:border-box}
body{font-family:'Zen Maru Gothic',sans-serif;min-height:100vh;background:linear-gradient(160deg,#e8fff4 0%,#f0fff8 50%,#f0f8ff 100%);display:flex;justify-content:center;align-items:flex-start;padding:20px}
.container{max-width:520px;width:100%;margin:0 auto}
.hero-card,.quiz-card,.result-card{background:#fff;border-radius:28px;box-shadow:0 8px 40px rgba(43,233,123,.18);margin-bottom:16px;overflow:hidden}
.hero-card{padding:36px 28px 28px;position:relative}
.char-img{display:block;width:220px;height:140px;object-fit:contain;margin:0 auto 12px;animation:float 3s ease-in-out infinite}
@keyframes float{0%,100%{transform:translateY(0)}50%{transform:translateY(-8px)}}
.badge{display:inline-block;background:linear-gradient(135deg,#43e97b,#38f9d7);color:#fff;font-size:.7em;font-weight:700;padding:4px 14px;border-radius:20px;margin-bottom:12px}
h1{font-size:1.55em;font-weight:900;color:#0a2520;line-height:1.4;margin-bottom:8px}
.subtitle{color:#888;font-size:.88em;line-height:1.6;margin-bottom:24px}
.start-btn{display:block;width:100%;padding:18px;border:none;border-radius:18px;background:linear-gradient(135deg,#43e97b 0%,#38f9d7 100%);color:#fff;font-family:inherit;font-size:1.1em;font-weight:700;cursor:pointer;transition:all .25s;box-shadow:0 6px 24px rgba(43,233,123,.4)}
.start-btn:hover{transform:translateY(-3px);box-shadow:0 10px 30px rgba(43,233,123,.5)}
.hint{text-align:center;font-size:.78em;color:#bbb;margin-top:12px}
.quiz-card{padding:28px 24px;display:none;animation:slideUp .35s ease}
@keyframes slideUp{from{opacity:0;transform:translateY(16px)}to{opacity:1;transform:translateY(0)}}
.quiz-card.active,.result-card.active{display:block}
.progress-wrap{display:flex;align-items:center;gap:10px;margin-bottom:24px}
.progress-track{flex:1;height:8px;background:#f0f0f0;border-radius:4px;overflow:hidden}
.progress-fill{height:100%;background:linear-gradient(90deg,#43e97b,#38f9d7);border-radius:4px;transition:width .4s ease}
.q-count{font-size:.8em;color:#aaa;white-space:nowrap;font-weight:700}
.q-label{display:inline-block;background:#f0faf5;color:#2d9a5e;font-size:.75em;font-weight:700;padding:3px 10px;border-radius:10px;margin-bottom:10px;border:1.5px solid #d5f0e5}
.question{font-size:1.18em;font-weight:700;color:#0a2520;line-height:1.65;margin-bottom:22px}
.opt-btn{display:flex;align-items:center;width:100%;padding:14px 18px;border:2px solid #f0f0f0;border-radius:14px;background:#fafafa;color:#333;font-family:inherit;font-size:.95em;font-weight:600;cursor:pointer;transition:all .2s;margin-bottom:10px;text-align:left;gap:10px}
.opt-btn::before{content:'';display:block;width:22px;height:22px;min-width:22px;border:2.5px solid #ddd;border-radius:50%;transition:all .2s}
.opt-btn:hover{border-color:#43e97b;background:#f0faf5;color:#2d9a5e}
.opt-btn:hover::before{border-color:#43e97b;background:#43e97b}
.result-card{display:none;animation:slideUp .35s ease}
.result-hero{padding:32px 24px 24px;text-align:center}
.result-emoji{font-size:4.5em;line-height:1;margin-bottom:8px;display:block;animation:popIn .5s cubic-bezier(.34,1.56,.64,1)}
@keyframes popIn{from{opacity:0;transform:scale(.5)}to{opacity:1;transform:scale(1)}}
.result-label{font-size:.8em;font-weight:700;letter-spacing:.1em;margin-bottom:6px;color:rgba(255,255,255,.8)}
.result-name{font-size:1.7em;font-weight:900;color:#fff;margin-bottom:12px}
.tags{display:flex;flex-wrap:wrap;gap:6px;justify-content:center}
.tag{padding:5px 14px;border-radius:20px;font-size:.78em;font-weight:700;background:rgba(255,255,255,.25);color:#fff}
.result-body{padding:16px 24px 24px}
.desc-box{background:#fafafa;border-radius:16px;padding:18px;margin-bottom:16px;font-size:.92em;line-height:1.85;color:#444}
.info-box{background:linear-gradient(135deg,#f0faf5,#e8f8f0);border-radius:16px;padding:18px;margin-bottom:16px;border:1.5px solid #d5f0e5}
.info-box h3{font-size:.9em;font-weight:700;color:#2d9a5e;margin-bottom:10px}
.info-box p{font-size:.88em;color:#555;line-height:1.7}
.section-head{font-size:.82em;font-weight:700;color:#bbb;letter-spacing:.1em;margin:16px 0 10px}
.all-grid{display:grid;grid-template-columns:1fr 1fr;gap:8px;margin-bottom:16px}
.type-chip{background:#f8f8f8;border-radius:14px;padding:12px;display:flex;align-items:center;gap:10px;border:2px solid transparent}
.type-chip.me{border-color:#43e97b;background:#f0faf5}
.tc-icon{font-size:1.6em}
.tc-name{font-size:.8em;font-weight:700;color:#333;line-height:1.3}
.tc-me{font-size:.7em;color:#2d9a5e;font-weight:700}
.share-row{display:grid;grid-template-columns:1fr 1fr;gap:10px;margin-top:20px}
.share-btn{padding:14px;border:none;border-radius:14px;font-family:inherit;font-size:.9em;font-weight:700;cursor:pointer;transition:all .2s}
.share-btn:hover{transform:translateY(-2px)}
.btn-x{background:#000;color:#fff}
.btn-line{background:#06C755;color:#fff}
.retry-btn{display:block;width:100%;padding:14px;border:2px solid #eee;border-radius:14px;background:#fff;font-family:inherit;font-size:.9em;font-weight:700;color:#999;cursor:pointer;margin-top:10px;transition:all .2s}
.retry-btn:hover{border-color:#43e97b;color:#2d9a5e}
</style>
</head>

const allTypes=[
{key:'T',emoji:'üóº',name:'Êù±‰∫¨ÔºàÈÉΩÂøÉ„Ç®„É™„Ç¢Ôºâ'},{key:'K',emoji:'‚õ©Ô∏è',name:'‰∫¨ÈÉΩ'},
{key:'F',emoji:'üçú',name:'Á¶èÂ≤°'},{key:'O',emoji:'üå∫',name:'Ê≤ñÁ∏Ñ'}
];
let current=0,scores={T:0,K:0,F:0,O:0};
function startQuiz(){document.getElementById('start').style.display='none';document.getElementById('quiz').classList.add('active');render();}
function render(){
  const q=questions[current];
  document.getElementById('progress').style.width=(current/questions.length*100)+'%';
  document.getElementById('qCount').textContent=(current+1)+'/'+questions.length;
  document.getElementById('qLabel').textContent='Q'+(current+1);
  document.getElementById('qText').textContent=q.q;
  const o=document.getElementById('options');o.innerHTML='';
  q.opts.forEach(opt=>{const b=document.createElement('button');b.className='opt-btn';b.textContent=opt.t;b.onclick=()=>answer(opt.s);o.appendChild(b);});
}
function answer(s){for(let k in s)scores[k]+=s[k];current++;if(current<questions.length)render();else showResult();}
function showResult(){
  let max='T',maxVal=0;for(let k in scores)if(scores[k]>maxVal){maxVal=scores[k];max=k;}
  const r=results[max];
  document.getElementById('quiz').classList.remove('active');
  const hero=document.getElementById('resultHero');hero.style.background=r.bg;
  document.getElementById('resultEmoji').textContent=r.emoji;
  document.getElementById('resultName').textContent=r.name;
  const tags=document.getElementById('resultTags');tags.innerHTML='';
  r.traits.forEach(t=>{const s=document.createElement('span');s.className='tag';s.textContent=t;tags.appendChild(s);});
  document.getElementById('resultDesc').textContent=r.desc;
  document.getElementById('spotBox').innerHTML='<h3>üìç „Åä„Åô„Åô„ÇÅ„Ç®„É™„Ç¢</h3><p>'+r.spot+'</p>';
  const ag=document.getElementById('allGrid');ag.innerHTML='';
  allTypes.forEach(t=>{ag.innerHTML+=`<div class="type-chip${t.key===max?' me':''}"><span class="tc-icon">${t.emoji}</span><div><div class="tc-name">${t.name}</div>${t.key===max?'<div class="tc-me">‚Üê „ÅÇ„Å™„ÅüÔºÅ</div>':''}</div></div>`;});
  document.getElementById('result').classList.add('active');
}
function shareX(){const n=document.getElementById('resultName').textContent;window.open(`https://x.com/intent/tweet?text=${encodeURIComponent('ÁßÅ„Åå‰Ωè„ÇÄ„Åπ„ÅçË°ó„ÅØ„Äå'+n+'„Äç„Åß„Åó„ÅüÔºÅüèôÔ∏è\n„ÅÇ„Å™„Åü„ÇÇË®∫Êñ≠„Åó„Å¶„Åø„Å¶üëá\n'+location.href)}`,'_blank');}
function shareLine(){window.open(`https://social-plugins.line.me/lineit/share?url=${encodeURIComponent(location.href)}`,'_blank');}
